import React from 'react';
import Container from 'react-bootstrap/Container';
import Row from 'react-bootstrap/Row';
import Col from 'react-bootstrap/Col';

function Footer() {
    return(
        <Container md={5}>
            Developed with React.
            <footer className="sticky-footer">
                <ul>
                    <li><a href="mailto:bryanjg2@illinois.edu" target="_blank" rel="noreferrer" className="default">Email</a></li>
                    <li><a href="https://linkedin.com/in/bryange" target="_blank" rel="noreferrer" className="default">LinkedIn</a></li>
                    <li><a href="https://github.com/bryange3" target="_blank" rel="noreferrer" className="default">GitHub</a></li>
                    <li><a href="https://instagram.com/bryangephoto" target="_blank" rel="noreferrer" className="default">Instagram</a></li>
                </ul>
            </footer>
        </Container>
    )
}

export default Footer;
